// Generate 100 data points
const totalPoints = 100;
const startDate = new Date(); // Current time as the start date
let data = [];

// Loop to create random values for Baca1Value and Baca2Value at 1-minute intervals
for (let i = 0; i < totalPoints; i++) {
    // Generate random values between a defined range (e.g., 0 to 100)
    const Baca1Value = Math.random() * 100;
    const Baca2Value = Math.random() * 100;

    // Calculate the record time for each point (1-minute intervals)
    const recordTime = new Date(startDate.getTime() + i * 60000); // 60000ms = 1 minute

    // Add the generated data to the array
    data.push({
        Baca1Value: Baca1Value.toFixed(2), // Optional: limit to 2 decimal places
        Baca2Value: Baca2Value.toFixed(2),
        RecordTime: recordTime.toISOString() // Convert to ISO string for easy handling
    });
}

// Output the generated data points
msg.payload = data;
return msg;
